import Home from "./Home";
import About from "./components/About";
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
            <Route exact path="/" component={Home} />
            <Route path=".components/About" component={About} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
